import React, { Component } from 'react';
import './App.css';

import Collapsible from 'react-collapsible';

class HubInfoBox extends Component {

    render(){
      return(
          <div>
        <div className="hubinfobox">
            <div className="hubinfoboxtitle">

                <div>
                    {this.props.url}:      
                </div>
                <div>
                    See More
                </div>

            </div>


        <div className="hubinfoboxinfo">
        <br/>
        Lorem 
        </div>

        </div>

        </div>
      )
    }
  }

export default HubInfoBox
